    "analysis": "Murray's best play of the day was a 57 yards zone-read run that he took for 57 yards, the longest run of his career. The broadcast pointed out that Murray hit 20.78 mph on the play, the fastest any quarterback has run all season. Murray totaled 74 yards on the ground and hand another 10+ run called back by a holding penalty. Murray wasn't quite as impactful through the air. He did have some nice throws, including a TD to Antoine Wesley that he dropped in the bucket from 24 yards out. Murray struggled a bit with accuracy, however, with balls both sailing high and landing at his receivers' feet. Murray also struggled to run the hurry-up offense without bleeding the clock when down two scores in the fourth quarter. Murray gets a very difficult test against the Cowboys in Week 17. He will be a QB1 but will have a lower floor than is ideal for the fantasy championship game.\u00a0\n",
