    "headlineNews": "Russell Wilson completed 16-of-27 passes for 181 yards and two touchdowns in the Seahawks' 25-24, Week 16 loss to the Bears.\u00a0\n",
    "report": "",
    "analysis": "With the loss, Seattle is eliminated from postseason contention for just the second time in Wilson's 10-year career. He flat-out wasn't good enough against a team running low on healthy corners and starting its No. 3 quarterback, targeting DK Metcalf and Tyler Lockett a combined 11 times, finding them for just 5/71/1. This, even as Rashaad Penny was relieving pressure on the ground with 17/135/1. The low point, besides an anemic final drive after Chicago converted a two-point conversion to go up 25-24 with 1:01 remaining, was a fourth quarter sequence where Wilson took an inexcusable 13-yard sack on third down to set up a 39-yard field goal that Jason Myers promptly missed. The magic just has not been there in the seven games since Wilson returned from his finger injury. He badly needs the offseason to get physically right, and perhaps either force a coaching change or trade. This era of Seahawks football is over ... after a Week 17 hosting of Detroit and Week 18 road trip to Arizona.\u00a0\u00a0\n",
