    "headlineNews": "Ryan Tannehill completed 22-of-29 passes for 209 yards, one touchdown and zero interceptions in the Titans' 20-17, Week 16 win over the 49ers, adding three carries for 22 additional yards.\u00a0\n",
    "report": "",
    "analysis": "Tannehill entered halftime a comical 10-of-13 for 40 yards as the Titans appeared to actively be trying to lose eight yards every first down. Thankfully things snapped into place after the break as the Titans erased a 10-point deficit and put themselves in position to win the AFC South if the Colts lose on Saturday evening to the Cardinals. Tannehill got the only memo that mattered: Target a returning A.J. Brown whenever possible. Brown's 16 looks were a new career high by three. Tanne's longest completion was a 42-yarder to Brown on a free play. The biggest play was Tannehill's 23-yard rush with 1:20 remaining. That set the Titans up for the game-winning kick. Largely off the streamer map for the past month as Brown convalesced, Tannehill is finally back in the mix, though the Dolphins are an awful Week 17 matchup.\u00a0\n",
