    "report": "",
    "analysis": "Well Samuel finally \"regressed\" in the rushing touchdown department, getting held out of the end zone on the ground for the first time in six games. The flipside was that he finally\u00a0progressed\u00a0as a receiver, reverting to his big-play, compiling ways from the first half of the season. The double-digit target performance was his first since Week 7, with the 100-yard game through the air his first since Week 8. The highlight was a fourth quarter, 56-yard catch-and-run where Samuel roasted\u00a0Kristian Fulton. He did come down hard at the end of the play, taking several minutes to regain his breath. That is our only concern with Samuel's second-half-of-the-season usage, as coach Kyle Shanahan is putting him in position to get\u00a0hit.\u00a0Samuel is taking far more contact than the average wideout. It seems like it will be difficult for him to hold up, but he mostly has so far, missing only one contest. Samuel will remain an all-purpose fantasy X factor for Week 17 against the rebuilding Texans.\u00a0\n",
